import { ReactElement } from 'react';
import { Portfolio, Stock } from './interfaces';


interface PortfolioTableProps {
    portfolio: Portfolio;
}

interface PortfolioTableRowProps {
    stock: Stock;
}

function PortfolioTableRow({stock}: PortfolioTableRowProps): ReactElement {
    return (
        <tr>
            <td>{stock.ticker}</td>
            <td>{stock.latestPrice}</td>
            <td>{stock.quantity}</td>
            <td>{stock.pricePurchased}</td>
        </tr>
    )
}

function PortfolioTable({portfolio}: PortfolioTableProps): ReactElement {
    return (
        <div>
            <table>
                <thead>
                    <tr>
                        <td>Ticker</td><td>Latest Price</td><td>Quantity</td><td>Price Purchased</td>
                    </tr>
                </thead>
                <tbody>
                    {portfolio.stocks.map((stock) => <PortfolioTableRow stock={stock}/>)}
                </tbody>
            </table>

        </div>
    )
}







export default PortfolioTable;
